#[derive(PartialEq, Clone)]
pub enum BodyDirections {
    // First 4 are the same as Movement
    Up = 0,
    Right = 1,
    Down = 2,
    Left = 3,
    Still = 4,
}

#[derive(PartialEq, Debug, Clone, Copy, Eq)]
pub struct ZobristHash {
    value: ValueInt,
}

impl ZobristHash {
    pub fn new() -> ZobristHash {
        ZobristHash {
            value: 0,
        }
    }

    pub fn xor_body_direction(&mut self, point: Point, player: usize, direction: BodyDirections) {
        self.value ^= BODY_DIRECTIONS[point.x as usize][point.y as usize][player][direction as usize];
    }

    pub fn xor_food(&mut self, point: Point) {
        self.value ^= FOOD[point.x as usize][point.y as usize];
    }

    pub fn xor_turn(&mut self, turn: i32) {
        // Spiral hazard included in turn
        self.value ^= turn as ValueInt;
    }

    pub fn get_value(&self) -> ValueInt {
        self.value
    }
}

pub struct ZobristHasher {
    v: u64
}

impl Hasher for ZobristHasher {
    fn finish(&self) -> u64 {
        self.v
    }

    // USE ONLY .write_u64() 
    fn write(&mut self, _bytes: &[u8]) {

    }

    fn write_u64(&mut self, i: u64) {
        self.v = i;
    }
}

impl Default for ZobristHasher {
    fn default() -> ZobristHasher {
        ZobristHasher { v: 0 }
    }
}

pub fn body_direction(start: Point, target: Point) -> BodyDirections {
    let diff_x = target.x - start.x;
    let diff_y = target.y - start.y;
    if diff_x == diff_y {
        return BodyDirections::Still;
    } else
    if diff_x > 0 {
        if diff_x == 1 {BodyDirections::Right} else {BodyDirections::Left}
    } else
    if diff_x < 0 {
        if diff_x == -1 {BodyDirections::Left} else {BodyDirections::Right}
    } else
    if diff_y > 0 {
        if diff_y == 1 {BodyDirections::Up} else {BodyDirections::Down}
    } else {
        if diff_y == -1 {BodyDirections::Down} else {BodyDirections::Up}
    }
}